import React from 'react';
import SelectAutoWidth from '../../Components/Select';
import BasicDatePicker from'../../Components/Data/Data'
import { TextField } from '@mui/material';
import { Button } from '@mui/material';
import { FormHelperText } from '@mui/material';
import './style.css'


// import { Container } from './styles';

class FormCadastro extends Component() {
  constructor(props) {
    super(props);
    this.nRegistronRegistro= "";
    this.usuDoCadastro = "";
    this.datadoCadastro = "";
    this.cod = "";
    this.coligada = "";
    this.codFilial= "";
    this.filial = "";
    this.setor = "";
    this.idPessoa = "";
    this.matricula= "";
    this.nomeCompleto = "";
    this.email = "";
    this.senha = "";
  }
  _handleMudancaCategoria(evento){
    evento.stopPropagation();
    this.categoria = evento.target.value;
    this.nRegistronRegistro= evento.target.value;
    this.usuDoCadastro = evento.target.value;
    this.datadoCadastro = evento.target.value;
    this.cod = evento.target.value;
    this.coligada = evento.target.value;
    this.codFilial= evento.target.value;
    this.filial = evento.target.value;
    this.setor = evento.target.value;
    this.idPessoa = evento.target.value;
    this.matricula= evento.target.value;
    this.nomeCompleto = evento.target.value;
    this.email = evento.target.value;
    this.senha = evento.target.value;
    
  }




  render(){
  return (
      <>
      
      <div className='pai'>
        <div className='div0' >
          <TextField onChange={this._handleMudancaCategoria.bind(this)}sx={{ m: 1}} className='nRegistro' id="outlined-basic" label="Nº Registro" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)}sx={{ m: 1}}id="outlined-basic" label="Usuário do Cadastro" variant="outlined" />
          <BasicDatePicker className='data'/>
        </div>
        <div className='div1' >
        <SelectAutoWidth sx={{ m: 1}}className='selects'/> 
        </div>
        <div className='div2'>
          <TextField onChange={this._handleMudancaCategoria.bind(this)}sx={{ m: 1}}id="outlined-basic" label="Cod " variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Coligada" variant="outlined" />
          <Button sx={{ m: 1}}variant="outlined">Atualizar Situacao</Button>
        </div>
        <div className='div3'>
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Cod. Filial" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Filial" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Setor" variant="outlined" />
        </div>
        <div className='div4'>
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Id Pessoa" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="Matricula" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)}sx={{ m: 1}}id="outlined-basic" label="Nome Completo" variant="outlined" />
        </div>
        <div className='div5'>
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" label="E-mail" variant="outlined" />
          <TextField onChange={this._handleMudancaCategoria.bind(this)} sx={{ m: 1}}id="outlined-basic" type="password"label="Senha" variant="outlined" />
          <FormHelperText>Senha (6 digitos)</FormHelperText>

        </div>
      </div>


      </>
  );
  }
}

export default FormCadastro;
